import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse(`{"title":"§ 19.2-92 Issuance of Governor's warrant of arrest; its recitals.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-92.md","filePath":"vacode/19.2-92.md"}`),o={name:"vacode/19.2-92.md"},i=a('<h1 id="§-19-2-92-issuance-of-governor-s-warrant-of-arrest-its-recitals" tabindex="-1">§ 19.2-92 Issuance of Governor&#39;s warrant of arrest; its recitals. <a class="header-anchor" href="#§-19-2-92-issuance-of-governor-s-warrant-of-arrest-its-recitals" aria-label="Permalink to &quot;§ 19.2-92 Issuance of Governor&#39;s warrant of arrest; its recitals.&quot;">​</a></h1><p>If the Governor decides that a demand for the extradition of a person, charged with, or convicted of, crime in another state should be complied with, he shall sign a warrant of arrest, which shall be sealed with the state seal, and be directed to the sheriff or sergeant of any county or city or to any peace officer or other person whom he may think fit to entrust with the execution thereof. The warrant must substantially recite the facts necessary to the validity of its issuance. Any electronically transmitted facsimile of a Governor&#39;s warrant shall be treated as an original document, provided the original is received within four working days of receipt of the facsimile.</p><p>Code 1950, § 19.1-56; 1960, c. 366; 1975, c. 495; 2001, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0214" target="_blank" rel="noreferrer">214</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0226" target="_blank" rel="noreferrer">226</a>; 2011, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0059" target="_blank" rel="noreferrer">59</a>.</p>',3),s=[i];function n(c,l,f,h,d,_){return r(),t("div",null,s)}const u=e(o,[["render",n]]);export{g as __pageData,u as default};
